[{"location":"dgbt/#DGBT","page":"DGBT","title":"DGBT","text":"","category":"section"},{"location":"dgbt/#Description","page":"DGBT","title":"Description","text":"","category":"section"},{"location":"dgbt/","page":"DGBT","title":"DGBT","text":"Base voltage groups data.","category":"page"},{"location":"dgbt/#Usage","page":"DGBT","title":"Usage","text":"","category":"section"},{"location":"dgbt/","page":"DGBT","title":"DGBT","text":"Column Description\nGroup Base voltage group, as defined in DBAR\nVoltage Base voltage associated to the group (kV)","category":"page"},{"location":"dgbt/#Example","page":"DGBT","title":"Example","text":"","category":"section"},{"location":"dgbt/","page":"DGBT","title":"DGBT","text":"(Image: Alt text)","category":"page"},{"location":"dger/#DGER","page":"DGER","title":"DGER","text":"","category":"section"},{"location":"dger/#Description","page":"DGER","title":"Description","text":"","category":"section"},{"location":"dger/","page":"DGER","title":"DGER","text":"Active generation bounds and participation factors data. Active power inbalance is distributed based on participation factors and active generation bounds","category":"page"},{"location":"dger/#Usage","page":"DGER","title":"Usage","text":"","category":"section"},{"location":"dger/","page":"DGER","title":"DGER","text":"Column Description\nNumber Bus identification number as defined in DBAR\nOperation Data addition or modification\nMinimum active generation Lower bound for active generation in the bus (MW)\nMaximum active generation Upper bound for active generation in the bus (MW)\nParticipation factor Participation factor in each generation bus (%)\nRemote control participation factor Generator participation factor in reactive power needed for bus voltage control (%)\nNominal power factor Machine nominal participation factor\nArmature service factor Armature service factor (%)\nRotor service factor Rotor service factor (%)\nCharge angle Maximum charge angle (°); accepts value in 0°- 85° range\nMachine reactance Machine reactance (%)\nNominal apparent power Machine nominal apparent power (%)","category":"page"},{"location":"dger/#Example","page":"DGER","title":"Example","text":"","category":"section"},{"location":"dger/","page":"DGER","title":"DGER","text":"(Image: Alt text)","category":"page"},{"location":"dbar/#DBAR","page":"DBAR","title":"DBAR","text":"","category":"section"},{"location":"dbar/#Description","page":"DBAR","title":"Description","text":"","category":"section"},{"location":"dbar/","page":"DBAR","title":"DBAR","text":"This section includes general information about AC buses, in columns described as follows:","category":"page"},{"location":"dbar/#Usage","page":"DBAR","title":"Usage","text":"","category":"section"},{"location":"dbar/","page":"DBAR","title":"DBAR","text":"Column Description\nNumber Bus identification number\nOperation Bus addition, removal or modification\nStatus Bus status - on or off\nType Bus type - PQ, PV or swing\nBase voltage group Bus voltage group identifier, defined in DGBT section. If there is no such section or the group is not defined there, base voltage will be set to 1.0 kv\nName Bus alphanumeric identification\nVoltage limit group Bus voltage bounds group identifier, defined in DGLT section. If there is no such section or the group is not defined there, bounds will be set to 0.9 and 1.1.\nVoltage Initial voltage (per unit)\nAngle Initial phase angle (degrees)\nActive generation Bus active generation (MW)\nReactive generation Bus reactive generation (Mvar)\nMinimum reactive generation Lower bound for bus reative generation (Mvar)\nMaximum reactive generation Upper bound for bus reative generation (Mvar)\nControlled bus Bus which voltage magnitude will be controlled as defined in Voltage field\nActive charge Bus active charge (MW)\nReactive charge Bus reactive charge (Mvar)\nTotal reactive power Total injected power by capacitor reactor banks; Positive value for capacitor and negative for reactors\nArea Number of area which the bus is a part of\nCharge definition voltage Voltage in which active and reactive charge were measured\nVisualization mode Bus visualization in ANAREDE software\nAggregator 1-10 Additional information","category":"page"},{"location":"dbar/#Example","page":"DBAR","title":"Example","text":"","category":"section"},{"location":"dbar/","page":"DBAR","title":"DBAR","text":"(Image: Alt text)","category":"page"},{"location":"dcnv/#DBAR","page":"DCNV","title":"DBAR","text":"","category":"section"},{"location":"dcnv/#Description","page":"DCNV","title":"Description","text":"","category":"section"},{"location":"dcnv/","page":"DCNV","title":"DCNV","text":"AC-DC converter data.","category":"page"},{"location":"dcnv/#Usage","page":"DCNV","title":"Usage","text":"","category":"section"},{"location":"dcnv/","page":"DCNV","title":"DCNV","text":"Column Description\nNumber Converter identification number\nOperation Converter addition or modification\nAC bus AC bus number, as defined in DBAR\nDC bus DC bus number, as defined in DCBA\nNeutral bus Neutral bus number, as defined in DCBA\nOperation mode Operation mode; R for rectifiers, I for inverters\nBridges Amount of twelve-pulse bridges\nCurrent Converter nominal current (A)\nCommutation reactance Commutation reactance by six-pulse bridges (%)\nSecondary voltage Transformer converter secondary voltage (kV)\nTransformer power Six-pulse transformer converter base power (MVA)\nReactor resistance Reactor resistance ((\\Omega))\nReactor indutance Reactor indutance (mH)\nCapacitance CCC capacitance ((\\mu)F)\nFrequency AC system frequency (Hz)","category":"page"},{"location":"dcnv/#Example","page":"DCNV","title":"Example","text":"","category":"section"},{"location":"dcnv/","page":"DCNV","title":"DCNV","text":"(Image: Alt text)","category":"page"},{"location":"dcte/#DCTE","page":"DCTE","title":"DCTE","text":"","category":"section"},{"location":"dcte/#Description","page":"DCTE","title":"Description","text":"","category":"section"},{"location":"dcte/","page":"DCTE","title":"DCTE","text":"Set parameters to be used in power flow solving.","category":"page"},{"location":"dcte/#Usage","page":"DCTE","title":"Usage","text":"","category":"section"},{"location":"dcte/","page":"DCTE","title":"DCTE","text":"Each parameter is defined by a four-letter code and its respective value","category":"page"},{"location":"dcte/#Example","page":"DCTE","title":"Example","text":"","category":"section"},{"location":"dcte/","page":"DCTE","title":"DCTE","text":"(Image: Alt text)","category":"page"},{"location":"dcba/#DCBA","page":"DCBA","title":"DCBA","text":"","category":"section"},{"location":"dcba/#Description","page":"DCBA","title":"Description","text":"","category":"section"},{"location":"dcba/","page":"DCBA","title":"DCBA","text":"DC bus data.","category":"page"},{"location":"dcba/#Usage","page":"DCBA","title":"Usage","text":"","category":"section"},{"location":"dcba/","page":"DCBA","title":"DCBA","text":"Column Description\nNumber DC bus identification number\nOperation Bus addition or modification\nType 0 for non-specified voltage, 1 for specified voltage (slack bus); one slack bus must be specified to each pole\nPolarity +- for positive pole; – for negative pole; 0 for neutral bus\nName Bus alphanumeric identification\nVoltage limit group Not used in PWF current version\nVoltage Initial bus voltage (kV); for slack buses, voltage to be kept constant\nGround electrode Ground electrode resistance ((\\Omega)); should only be filled for neutral buses\nDC link DC link number, as defined in DELO; each bus on the same pole or bipole must be from the same DC link","category":"page"},{"location":"dcba/#Example","page":"DCBA","title":"Example","text":"","category":"section"},{"location":"dcba/","page":"DCBA","title":"DCBA","text":"(Image: Alt text)","category":"page"},{"location":"dccv/#DCCV","page":"DCCV","title":"DCCV","text":"","category":"section"},{"location":"dccv/#Description","page":"DCCV","title":"Description","text":"","category":"section"},{"location":"dccv/","page":"DCCV","title":"DCCV","text":"AC-DC converter control data.","category":"page"},{"location":"dccv/#Usage","page":"DCCV","title":"Usage","text":"","category":"section"},{"location":"dccv/","page":"DCCV","title":"DCCV","text":"Column Description\nNumber Converter control identifier number, as defined in DCNV\nOperation Converter control addition, modification or removal\nLooseness F for loose converter, N for normal one; One loose converter must be specified for each pole\nInverter control mode G for gamma control, T for interface AC bus voltage control. Only valid to CCC inverters\nConverter control type C for converter control with constant current, P for constant power\nSpecified value Specified value for converter control (A for current control, MW for power control)\nCurrent margin Inverter current margin as defined in DCNV (nominal current %)\nMaximum overcurrent Maximum overcurrent allowed for converter, as defined in DCNV (nominal current %)\nConverter angle Desired converter angle (°)\nMinimum converter angle Minimum desired converter angle (°)\nMaximum converter angle Maximum desired converter angle (°)\nMinimum transformer tap Minimum transformer tap\nMaximum transformer tap Maximum transformer tap\nTransformer tap number of steps Transformer tap number of steps, where a step is the difference between maximum and minimum type divided by the number of steps\nMinimum DC voltage for power control DC voltage below which a converter power controller operates in current control\nTap Hi MVAr mode Converter tap value when Hi MVAr consumption mode, defined in DELO, is on\nTap reduced voltage mode Converter tap value when operating at lower voltage mode","category":"page"},{"location":"dccv/#Example","page":"DCCV","title":"Example","text":"","category":"section"},{"location":"dccv/","page":"DCCV","title":"DCCV","text":"(Image: Alt text)","category":"page"},{"location":"quickguide/#Quick-Start-Guide","page":"Getting Started","title":"Quick Start Guide","text":"","category":"section"},{"location":"quickguide/","page":"Getting Started","title":"Getting Started","text":"Parsing a .pwf file to Julia dictionary is as simple as:","category":"page"},{"location":"quickguide/","page":"Getting Started","title":"Getting Started","text":"using PWF\n\nfile = \"3bus.pwf\"\npwf_dict = parse_pwf(file)","category":"page"},{"location":"quickguide/","page":"Getting Started","title":"Getting Started","text":"Converting the .pwf file into PowerModels.jl network data dictionary:","category":"page"},{"location":"quickguide/","page":"Getting Started","title":"Getting Started","text":"network_data = parse_pwf_to_powermodels(file)","category":"page"},{"location":"quickguide/","page":"Getting Started","title":"Getting Started","text":"Then you are ready to use PowerModels!","category":"page"},{"location":"quickguide/","page":"Getting Started","title":"Getting Started","text":"using PowerModels, Ipopt\n\nrun_ac_pf(network_data, Ipopt.Optimizer)","category":"page"},{"location":"quickguide/","page":"Getting Started","title":"Getting Started","text":"For more information about PowerModels.jl visit the PowerModels documentation","category":"page"},{"location":"quickguide/#Parser","page":"Getting Started","title":"Parser","text":"","category":"section"},{"location":"quickguide/","page":"Getting Started","title":"Getting Started","text":"The package parses all available sections into a julia dictionary. Every key represents a .pwf section as shown below:","category":"page"},{"location":"quickguide/","page":"Getting Started","title":"Getting Started","text":"julia> PWF.parse_pwf(file)\nDict{String, Any} with 6 entries:\n  \"DLIN\" => Dict{String, Any}[Dict(\"AGGREGATOR 10\"=>nothing, \"AGGREGATOR 5\"=>nothing, \"AGGR\"…\n  \"name\" => \"3bus\"\n  \"DBAR\" => Dict{String, Any}[Dict(\"AGGREGATOR 10\"=>nothing, \"ANGLE\"=>0.0, \"MINIMUM REACTIV\"…\n  \"TITU\" => \"Ande Case\"…\n  \"DCTE\" => Dict{String, Any}(\"TLVC\"=>0.5, \"APAS\"=>90.0, \"BASE\"=>100.0, \"STIR\"=>1.0, \"CPAR\"…\n  \"DOPC\" => Dict{String, Any}(\"CONT\"=>'L', \"CELO\"=>'L' \"MOST\"=>'L', \"MOSF\"=>'L', \"RCVG\"=>'…","category":"page"},{"location":"quickguide/#PowerModels.jl-converter","page":"Getting Started","title":"PowerModels.jl converter","text":"","category":"section"},{"location":"quickguide/","page":"Getting Started","title":"Getting Started","text":"The package also allow converting .pwf file directly into PowerModels.jl network data structure:","category":"page"},{"location":"quickguide/","page":"Getting Started","title":"Getting Started","text":"julia> PWF.parse_pwf_to_powermodels(file)\nDict{String, Any} with 13 entries:\n  \"bus\"            => Dict{String, Any}(\"1\"=>Dict{String, Any}(\"zone\"=>1, \"bus_i\"=>1, \"bus_\"…\n  \"source_type\"    => \"pwf\"\n  \"name\"           => \"3bus\"\n  \"dcline\"         => Dict{String, Any}()\n  \"source_version\" => \"09\"\n  \"branch\"         => Dict{String, Any}(\"1\"=>Dict{String, Any}(\"br_r\"=>0.181, \"shift\"=>-0.0…\n  \"gen\"            => Dict{String, Any}(\"1\"=>Dict{String, Any}(\"pg\"=>11.52, \"model\"=>2, \"sh\"…\n  \"storage\"        => Dict{String, Any}()\n  \"switch\"         => Dict{String, Any}()\n  \"baseMVA\"        => 100.0\n  \"per_unit\"       => false\n  \"shunt\"          => Dict{String, Any}()\n  \"load\"           => Dict{String, Any}(\"1\"=>Dict{String, Any}(\"source_id\"=>Any[\"load\", 3, …","category":"page"},{"location":"dcer/#DCER","page":"DCER","title":"DCER","text":"","category":"section"},{"location":"dcer/#Description","page":"DCER","title":"Description","text":"","category":"section"},{"location":"dcer/","page":"DCER","title":"DCER","text":"Static reactive compensator data","category":"page"},{"location":"dcer/#Usage","page":"DCER","title":"Usage","text":"","category":"section"},{"location":"dcer/","page":"DCER","title":"DCER","text":"Column Description\nBus Bus number as defined in DBAR\nOperation Static reactive compensator data addition, removal or modification\nGruop Static reactive compensator group identification number; One or more groups can be connected to the same bus\nUnities Number of unities which constitute the group\nControlled bus Bus number, as defined in DBAR, which voltage will be controlled\nInclination Slope of the linear piece of the static reactive compensator model curve (%)\nReactive generation Current reactive power generation\nMinimum reactive generation Lower reactive generation bound that defines the linear piece of the static reactive compensator model curve\nMaximum reactive generation Upper reactive generation bound that defines the linear piece of the static reactive compensator model curve\nControl mode P for power control generated by the compensator; I for current control injected by the compensator\nStatus L if the compensator group is on, D if it is off","category":"page"},{"location":"dcer/#Example","page":"DCER","title":"Example","text":"","category":"section"},{"location":"dcer/","page":"DCER","title":"DCER","text":"(Image: Alt text)","category":"page"},{"location":"dcli/#DBAR","page":"DCLI","title":"DBAR","text":"","category":"section"},{"location":"dcli/#Description","page":"DCLI","title":"Description","text":"","category":"section"},{"location":"dcli/","page":"DCLI","title":"DCLI","text":"DC line data.","category":"page"},{"location":"dcli/#Usage","page":"DCLI","title":"Usage","text":"","category":"section"},{"location":"dcli/","page":"DCLI","title":"DCLI","text":"Column Description\nFrom bus Number of the bus from one of the extremities, as defined in DCBA\nOperation Line addition or modification\nTo bus Number of the bus from the other extremity, as defined in DCBA\nCircuit Identification number of the DC line in parallel\nOwner Not used in PWF current version\nResistance DC line resistance ((\\Omega))\nInductance DC line reactance (mH)\nCapacity DC line charging capacity for flow management (MW)","category":"page"},{"location":"dcli/#Example","page":"DCLI","title":"Example","text":"","category":"section"},{"location":"dcli/","page":"DCLI","title":"DCLI","text":"(Image: Alt text)","category":"page"},{"location":"dopc/#DOPC","page":"DOPC","title":"DOPC","text":"","category":"section"},{"location":"dopc/#Description","page":"DOPC","title":"Description","text":"","category":"section"},{"location":"dopc/","page":"DOPC","title":"DOPC","text":"Execution control options data. Turn power flow solving options on and off.","category":"page"},{"location":"dopc/#Usage","page":"DOPC","title":"Usage","text":"","category":"section"},{"location":"dopc/","page":"DOPC","title":"DOPC","text":"Each option is defined on a pair, composed of a four-letter code to represent the execution option and a letter to determine it status - L for on, D for off.","category":"page"},{"location":"dopc/#Example","page":"DOPC","title":"Example","text":"","category":"section"},{"location":"dopc/","page":"DOPC","title":"DOPC","text":"(Image: Alt text)","category":"page"},{"location":"dshl/#DSHL","page":"DSHL","title":"DSHL","text":"","category":"section"},{"location":"dshl/#Description","page":"DSHL","title":"Description","text":"","category":"section"},{"location":"dshl/","page":"DSHL","title":"DSHL","text":"AC circuit shunt data. This section enables association between shunt devices and AC circuits, facilitating failure simultation. This devices are automatically removed or inserted alongside the associated circuit.","category":"page"},{"location":"dshl/#Usage","page":"DSHL","title":"Usage","text":"","category":"section"},{"location":"dshl/","page":"DSHL","title":"DSHL","text":"Column Description\nFrom bus Bus number from one circuit extremity, as defined in DBAR\nOperation Shunt addition, removal or modification\nTo bus Bus number from the other circuit extremity, as defined in DBAR\nCircuit Identification number of the AC circuit\nShunt from Shunt reactive power in 'from bus' extremity for nominal voltage (1.0 p.u.) (Mvar)\nShunt to Shunt reactive power in 'to bus' extremity for nominal voltage (1.0 p.u.) (Mvar)\nStatus from On or off status for 'from bus' extremity\nStatus to On or off status for 'to bus' extremity","category":"page"},{"location":"dshl/#Example","page":"DSHL","title":"Example","text":"","category":"section"},{"location":"dshl/","page":"DSHL","title":"DSHL","text":"(Image: Alt text)","category":"page"},{"location":"dglt/#DGBT","page":"DGLT","title":"DGBT","text":"","category":"section"},{"location":"dglt/#Description","page":"DGLT","title":"Description","text":"","category":"section"},{"location":"dglt/","page":"DGLT","title":"DGLT","text":"Voltage bounds groups data.","category":"page"},{"location":"dglt/#Usage","page":"DGLT","title":"Usage","text":"","category":"section"},{"location":"dglt/","page":"DGLT","title":"DGLT","text":"Column Description\nGroup Voltage bounds group, as defined in DBAR\nLower bound Minimum voltage value of the group (per unit)\nUpper bound Maximum voltage value of the group (per unit)\nLower emergency bound Minimum voltage value of the group at emergency conditions (per unit)\nUpper emergency bound Maximum voltage value of the group at emergency conditions (per unit)","category":"page"},{"location":"dglt/#Example","page":"DGLT","title":"Example","text":"","category":"section"},{"location":"dglt/","page":"DGLT","title":"DGLT","text":"(Image: Alt text)","category":"page"},{"location":"delo/#DELO","page":"DELO","title":"DELO","text":"","category":"section"},{"location":"delo/#Description","page":"DELO","title":"Description","text":"","category":"section"},{"location":"delo/","page":"DELO","title":"DELO","text":"DC link data.","category":"page"},{"location":"delo/#Usage","page":"DELO","title":"Usage","text":"","category":"section"},{"location":"delo/","page":"DELO","title":"DELO","text":"Column Description\nNumber DC link identification number\nOperation DC link data addition or modification\nVoltage DC link nominal operation voltage (kV)\nBase DC link base power (MW)\nName DC link alphanumeric identification\nHi MVAR mode Selects DC link operation mode; N for normal mode, H for HIMVAr consumption mode\nStatus L for on, D for off","category":"page"},{"location":"delo/#Example","page":"DELO","title":"Example","text":"","category":"section"},{"location":"delo/","page":"DELO","title":"DELO","text":"(Image: Alt text)","category":"page"},{"location":"dbsh/#DBSH","page":"DBSH","title":"DBSH","text":"","category":"section"},{"location":"dbsh/#Description","page":"DBSH","title":"Description","text":"","category":"section"},{"location":"dbsh/","page":"DBSH","title":"DBSH","text":"Capacitor or reactor banks connected to AC buses or branches. For groups or banks connected to the same bus, minimum and maximum voltage, controlled bus and voltage control strategies will always be the same. In that sense, capacitors/reactors connected to a branch are considered as connected to the bus of the end which they are connected.","category":"page"},{"location":"dbsh/#Usage","page":"DBSH","title":"Usage","text":"","category":"section"},{"location":"dbsh/","page":"DBSH","title":"DBSH","text":"Column Description\nFrom bus Either the bus number which shunt capacitor/reactor banks are connected or bus number from one of the circuit ends where line capacitor/reactor banks are connected.\nOperation Groups or banks addition, removal or modification\nTo bus Bus number from the other end where line capacitor/reacor banks are connected; Not used for shunt capacitor/reactor banks\nCircuit AC circuit identification number\nControl mode Automatic switching control; C for continuous, D for discrete and F for fixed\nMinimum voltage Lower bound for voltage range that determinates automatic switching control\nMaximum voltage Upper bound for voltage range that determinates automatic switching control\nControlled bus Bus number which voltage will be controlled by automatic switching control or reactors connected to the bus defined in Bus field; Controlled voltage value depends on the fields Control and Control Type\nInitial reactive injection Initial reactive injection due to capacitor/reactor banks connected in the bus (Mvar); This field aims to represent initial reactive power injection value for power flow solving; If control mode is fixed, this value represents what is effectively injected in the bus\nControl type C if control is made by the center of the voltage range, L if it is made by the violated bounds\nErase DBAR data? If filled with 'S', value in Capacitor/Reactor field (DBAR section) will be erased\nExtremity Bus number from the circuit end where shunt capacitor/reactor banks are connected to","category":"page"},{"location":"dbsh/#Capacitor/Reactor-banks","page":"DBSH","title":"Capacitor/Reactor banks","text":"","category":"section"},{"location":"dbsh/","page":"DBSH","title":"DBSH","text":"Column Description\nGroup or bank Identification number; Each group or bank can have one or more switching stages\nOperation Capacitor/reactor banks or group data addition, removal or modification\nStatus L if the group or bank is on, D if it is off\nUnities Total number of unities or stages that constitute the group or bank. This field is used as memory of the total number and the maximum allowed for each bus is 6\nOperating unities Total number of unities or stages that constitute the group or bank that are effectively in operation\nCapacitor reactor Total reactive power injected by one unity(Mvar); This value refers to the injected reactive power at nominal voltage (1.0 p.u.) and should be positive for capacitors and negative for reactors","category":"page"},{"location":"dbsh/#Example","page":"DBSH","title":"Example","text":"","category":"section"},{"location":"dbsh/","page":"DBSH","title":"DBSH","text":"(Image: Alt text)","category":"page"},{"location":"dlin/#DLIN","page":"DLIN","title":"DLIN","text":"","category":"section"},{"location":"dlin/#Description","page":"DLIN","title":"Description","text":"","category":"section"},{"location":"dlin/","page":"DLIN","title":"DLIN","text":"This section includes information about circuit data, both for branches and transformers, in columns described as follows:","category":"page"},{"location":"dlin/#Usage","page":"DLIN","title":"Usage","text":"","category":"section"},{"location":"dlin/","page":"DLIN","title":"DLIN","text":"Column Description\nFrom bus Bus number from one of the ends\nOpening from bus On or off status for the bus defined in 'From bus'\nOpening to bus On or off status for the bus defined in 'To bus'\nTo bus Bus number from the other end\nCircuit Identification number of the circuit\nStatus Status of the circuit - on or off\nOwner Whether the circuit belongs to the area of 'From bus' or 'To bus'. Power losses are accounted for that area and flows are calculated in that bus\nResistance Circuit resistance (%). For transformers, resistance for nominal tap.\nReactance Circuit reactance (%). For transformers, reactance for nominal tap.\nShunt susceptance Total circuit shunt susceptance (Mvar)\nTap For fixed tap transformers, 'From bus' tap; For variable ones, the estimated value (per unit).\nMinimum tap Lower tap bound for variable tap transformers (per unit)\nMaximum tap Upper tap bound for variable tap transformers (per unit)\nLag Angle lag for out-of-phase transformers, applied in relation to 'From bus' (degrees).\nControlled bus Bus number which voltage should be controlled, for variable tap transformers\nNormal capacity Circuit loading capacity at normal conditions (MVA)\nEmergency capacity Circuit loading capacity at emergency conditions (MVA)\nNumber of taps Amount of variable tap transformers positions, including minimum and maximum tap\nEquipament capacity Lower capacity equipament connected to the circuit\nAggregator 1-10 Additional information","category":"page"},{"location":"dlin/#Example","page":"DLIN","title":"Example","text":"","category":"section"},{"location":"dlin/","page":"DLIN","title":"DLIN","text":"(Image: Alt text)","category":"page"},{"location":"dcsc/#DCSC","page":"DCSC","title":"DCSC","text":"","category":"section"},{"location":"dcsc/#Description","page":"DCSC","title":"Description","text":"","category":"section"},{"location":"dcsc/","page":"DCSC","title":"DCSC","text":"Controllable series compensator data","category":"page"},{"location":"dcsc/#Usage","page":"DCSC","title":"Usage","text":"","category":"section"},{"location":"dcsc/","page":"DCSC","title":"DCSC","text":"Column Description\nFrom bus Bus number, as defined on DBAR, from on of the compensator ends\nOperation Compensator data addition, removal or modification\nTo bus Bus number, as defined on DBAR, from the other compensator end\nCircuit AC circuit identification number\nStatus Circuit status\nOwner F if the circuit belongs to the area from the bus in From bus, T if it belongs to To bus area\nBypass L if bypass is on, D if it is off\nMinimum value Compensator reactance minimum value (%)\nMaximum value Compensator reactance maximum value (%)\nInitial value Compensator reactance initial value (%)\nControl mode P for constant power, where active power flow specified value is kept while compensator reactance values are kept in bounds; I for constant current, where the current module specified value is kept while compensator reactance values are kept in bounds; X for constant reactance, where the compensator is not used and reactance is fixed at the specified value\nSpecified value If control mode is constant power, active power flow in the compensator (MW); If control mode is constant current, compensator current module (p.u.); If control mode is constant reactance, compensator reactance (%)\nMeasuring extremity Bus number from the compensator end where power or current is measured\nNumber of stages Number of stages for discrete compensators (Thyristor Switched Series Capacitor); Default value for continuous compensators (Thyristor Controlled Series Capacitor)\nAggregator 1-6 Additional information","category":"page"},{"location":"dcsc/#Example","page":"DCSC","title":"Example","text":"","category":"section"},{"location":"dcsc/","page":"DCSC","title":"DCSC","text":"(Image: Alt text)","category":"page"},{"location":"#PWF.jl","page":"Home","title":"PWF.jl","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"CurrentModule = PWF","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"PWF.jl is a Julia package for converting ANAREDE data format (\".pwf\") into a Julia dictionary.","category":"page"},{"location":"","page":"Home","title":"Home","text":"Additionaly, PWF provides parsing .pwf file directly to PowerModels.jl network data dictionary.","category":"page"},{"location":"","page":"Home","title":"Home","text":"The implementations were made based on the ANAREDE user guide manual (v09).","category":"page"},{"location":"","page":"Home","title":"Home","text":"Quickguide","category":"page"},{"location":"","page":"Home","title":"Home","text":"Parsing a .pwf file to Julia dictionary is as simple as:","category":"page"},{"location":"","page":"Home","title":"Home","text":"using PWF\n\nfile = \"3bus.pwf\"\npwf_dict = parse_pwf(file)","category":"page"},{"location":"","page":"Home","title":"Home","text":"Converting the .pwf file into PowerModels.jl network data dictionary:","category":"page"},{"location":"","page":"Home","title":"Home","text":"network_data = parse_pwf_to_powermodels(file)","category":"page"},{"location":"","page":"Home","title":"Home","text":"Then you are ready to use PowerModels!","category":"page"},{"location":"","page":"Home","title":"Home","text":"using PowerModels, Ipopt\n\nrun_ac_pf(network_data, Ipopt.Optimizer)","category":"page"},{"location":"","page":"Home","title":"Home","text":"For more information about PowerModels.jl visit the PowerModels documentation","category":"page"},{"location":"#Parser","page":"Home","title":"Parser","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"The package parses all available sections into a julia dictionary. Every key represents a .pwf section as shown below:","category":"page"},{"location":"","page":"Home","title":"Home","text":"PWF Sections Available:","category":"page"},{"location":"","page":"Home","title":"Home","text":"DBAR\nDLIN\nDGBT\nDGLT\nDGER\nDSHL\nDCBA\nDCLI\nDCNV\nDCCV\nDELO\nDCER\nDBSH (fban)\nDOPC\nDCTE","category":"page"},{"location":"","page":"Home","title":"Home","text":"Incoming Sections:","category":"page"},{"location":"","page":"Home","title":"Home","text":"DARE\nDCAI\nDCAR\nDCSC\nDGEI\nDGLT\nDINJ\nDMFL\nDMOT\nDMTE\nTITU","category":"page"},{"location":"#PowerModels.jl-converter","page":"Home","title":"PowerModels.jl converter","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"The package also allow converting .pwf file directly into PowerModels.jl network data structure:","category":"page"},{"location":"","page":"Home","title":"Home","text":"Network Data Sections Available:","category":"page"},{"location":"","page":"Home","title":"Home","text":"bus\ngen\nload\nbranch\ndcline\nshunt","category":"page"},{"location":"","page":"Home","title":"Home","text":"Incoming Network Data Sections:","category":"page"},{"location":"","page":"Home","title":"Home","text":"switch\nstorage","category":"page"},{"location":"#Contributing","page":"Home","title":"Contributing","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"PRs such as adding new sections and fixing bugs are very welcome!\nFor nontrivial changes, you'll probably want to first discuss the changes via issue.","category":"page"},{"location":"pwf_overview/#PWF-Overview","page":"Overview","title":"PWF Overview","text":"","category":"section"}]
